import React from 'react'

const Login = () => {
  return (
    <div className='absolute top-0 left-0 bg-white w-screen h-screen'>
        <div className='text-black'>
            <img src="https://static01.nyt.com/images/2022/03/02/crosswords/alpha-wordle-icon-new/alpha-wordle-icon-new-smallSquare252-v3.png?format=pjpg&quality=75&auto=webp&disable=upscale" alt="" />
        </div>
    </div>

  )
}

export default Login
